import React from 'react';
import ReactDOM from 'react-dom';

class Hello extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: "Hòa",
            age:"20",
            msg: "Hello"
        }
    }
    render() {
        return <h1>{this.state.name}</h1> ,
         <h1>{this.state.age}</h1> ,
         <h1>{this.state.msg}</h1>;
    }
}
export default Hello;
